I auditioned for The Real World my freshmen year of college (05) (massive open audition- they had approximately zero interest in *moi*). There were thousands of people waiting in line at Boston’s Government Center for a chance to be cast, all quickly signing a several page contract spelled out in micro font that no one in the crowd possibly could have read before sitting down in groups to play Two Truths and a Lie in front of a junior casting director as everyone tried their hardest to show how extra they were (a girl sitting next to me told as one of her truths in perhaps the thickest Boston accent I have ever heard “last week at a bah in Worcester (pronounced Whustah) I fell down the stairs and I PISSED MYSELF.” She, like me, was not cast.) I played the game, handed in the contract, and never heard a word. In 2006 Real World audition came back to Boston and my coworker and I stopped by on our lunch breaks to try again. We signed the contract and stood in line for as long as we could before eventually having to go back to work without having auditioned/handed in our contracts. Later I read some of the terms of the contract that actually had lines saying something along the lines of “I am aware that by signing this contract I am subjecting myself to public humiliation, condemnation, and ridicule”- a contract that thousands of us eagerly signed without reading as we waited in line with hopes to have the opportunity to subject ourselves to public ridicule on national television. 2000s reality TV was a whacky time to say the very least. #2000sRealityRoundup
