In 6th grade, my social studies teacher announced we'd be having an international food potluck and each student was required to select a country and bring a dish to share with the class representing said country. This event promised to be the greatest and most international feast my small mountain town had ever seen with flavors and ingredients that were sure to challenge, delight, and broaden our culinary horizons (it ended up being, like, a LOT of pasta). 

My dad, a pretty incredible cook, was excited about all of the different dishes we could make together. Honor our heritage and make Swedish meatballs? Branch out and try something with plantains? No, pops, I got this. I planned to make my absolute favorite foreign delicacy to share with my classmates and proudly announced that the country I would be representing was *EUROPE* and the dish I would be bringing was *checks notes* ✨Orange Fanta✨ #dontyouwantawantafanta . 

I had traveled to a few different countries in Europe the summer before and my sophisticated 11 year old palette had fallen head over heels in love with orange Fanta, a drink not yet for sale in the states. When I returned home from the trip and people had asked me about what it was like traveling in Europe, my stories were almost exclusively about Fanta, a drink I would describe passionately as being more flavorful and not as sweet as the trash American orange sodas #refinedaf. 

In efforts to recreate this foreign food from the country of Europe, I took a frozen tube of orange juice concentrate, mixed it with seltzer water, and poured it all into a juice pitcher onto which I taped a piece of paper that I had handwritten FANTA on. "Do you want to try Fanta?" I'd ask my classmates. "It's... European." 💅

