In my 20s I lived in Seoul for a few years. I had mornings off and briefly experimented with what life would be like as the type of person who woke up early and went to the gym before work (#didntlast). On day two of life as the type of person who woke up early and went to gym before work, I decided to treat myself to a celebratory cup of coffee that would normally be very out of my budget from the v swanky department store across the street. Waiting for my latte, I noticed that the fancy people around me were looking at me a lot, one might even say staring. I was feelin it. They must just be impressed by ✨me✨, you know, the type of person who wakes up early and goes to the gym before work. Then I felt a tap on my shoulder. I looked up from my phone to see an ancient security guard pointing to the floor where my underwear and spiderman socks were on proud display for all to see in the busy department store. Mortified, I quickly stuffed my delicates back into my unzipped gym bag and buried myself in my phone. Maybe a minute later I looked up and to see that he was still there, smiling. "I like you." he said, then patted me on the head and walked away. #bless

