The year? ✨2007✨. Me? An elated college junior beginning my third week as a marketing intern at Boston's LITTEST (now defunct) radio station, WFNX.

The Task? Drive the *massive* radio station van  which was covered in a station branded wrapper making the windows next to useless, all by myself, all the way to a small town in New Hampshire where I was to stand in a sandwich shop for the afternoon handing out WFNX swag to the sandwich eating locals. 

What qualified me to do this task? Being the only intern with a driver's license (of course hiding the fact that I’d only ever really driven in the mountains of Colorado/suburbs of Denver and that city driving typically made me weep) 

The issue? It was 2007 and GPS wasn’t really a thing. The only navigation I had was a printed mapquest map that directed me from the radio station in Lynn, MA to whatever town it was in NH. Mapquest only worked if you stayed on course (which I did not) with one wrong turn rendering said printed mapquest map entirely useless - and trust when I say I took *many* wrong turns). 

The gigantic basically windowless van had a radio that would only allow me to play WFNX, a station that at the time played Feist's 1234 (telllll me that ya love me more) every third song. 45 minutes and approximately 9 1234s into the mission, lucky passersby could spot the WFNX fan flying down the highway driven by ✨me✨ full on ugly sobbing while on the phone with my dad who was attempting to glean through my sobs and snorts exactly where I was so that he could get a NEW Mapquest situation sorted out where he was to then talk me through every single turn every turn so I could get back on track to New Hampshire. 

I was compLETEly lost, ended up in Maine, never made it to the damn sandwich shop and never listened to 1234 again (until just now- and have to say, this song slaps.) 

