My Grandpa Wally was a dentist w a v loyal following of old people who lived in Denver in the 90s and absolutely swore by him. *And* the fact that he owned his own practice meant that anyone in the family could get as much dental work as they wanted for FREE. Naturally, everyone in the family was very happy with this setup. Everyone except for ✨me✨. 

I thought that a trip to the dentist was likely a super fun experience when that dentist was not Grandpa Wally. I'd heard stories from classmates that their dentists gave out prizes and colorful toothbrushes! One kid said that *his* dentist had a dentist chair that looked like a racecar! Titillating, right?! 

Gramps did none of that. He was a no-nonsense man who believed that you shouldn’t be rewarded for doing things that are basic necessities, like getting your teeth cleaned.

After months of campaigning, I finally got my parents to agree to take me to the fun dentist, the one that had the race car chair. The day came & my dad picked me up after school and even surprised me with a big slice of pizza which I ate on the way to the appointment. I was LIVING. When we arrived I was thrilled to see the rumors were true. Cartoons! Race car chairs! 10 kids getting their teeth cleaned together all in one big room (some of whom I knew from class!)! What a time to be aLIVE! 

Ten minutes into my cleaning I suddenly found myself gagging a bit... perhaps eating pizza before a situation where someone's hands are in your mouth for extended periods of time was not the best call? And that, dear reader, is when I puked. And then promptly burst into tears. "EWWWWWWW!" screamed the other children, including the kids I knew from school. Mortifying.

And that is how I ended up back with gramps. There may not be prizes or racecars, but there was no shame and zero chance that anyone from school would be in the room, and that meant more to me than any little green parachute man and a new sparkly toothbrush ever could. 

