My parents have never shied away from dropping a well timed F bomb. Growing up, when traveling to visit my deeply religious and conservative Wisconsin grandparents, we'd always spend the two minute stretch before pulling into their driveway chanting every bad word we knew as a family just to get it out of our collective systems so we wouldn't accidentally say a potty word in front of grandma, knowing the shock of hearing darling 6 year old me saying "asshat" would likely push her over the edge. 

We were, for the most part, successful in our attempts to pull one over on dear old gram gram and pop pop who remained in the dark as to the true nature of their offspring, but that didn't mean we didn't get the occasional call home from a teacher letting mom or dad know what level of profanity their darling child had achieved in class that day. 

Realizing that my brother and I may need a better understanding of when and where it was appropriate to curse, my parents decided to implement a policy where we did chores in exchange for one swear word a week. We'd earn our word (this taught us that swear words didn't need to be used in every sentence, just where needed to let off steam and/or sprinkle in some comedic emphasis) and would have to ask them permission before we used it (which taught us timing and setting in which such a word was appropriate). I would like to take this moment to applaud my parents in what I consider to be an example of *chef's kiss* parenting. 

To my dear mom and dad, I am v sorry that I am not giving you any grandkids, but I will always happily draw pictures and send you photos of my dogs for you to hang on the fridge XOXO 

