I've never been a big gym person. I love walking but the indoor communal exercise experience just isn't for me. One gym memory, however, will absolutely never stop occupying a major spot in my brain. 

In my mid-20s I spent several days in North Korea. I was there working with an NGO. Everyone in our group had been assigned government minders who were with us at all times. Days started early, we were eating breakfast by 7:30, and we were always back at the hotel by 5. Once we were back at the hotel, we weren't allowed to leave. Even taking a walk down the road from the hotel was not allowed. We spent most of the days sitting in meetings or vans. We were also very well fed, I was told that this is a common experience for foreign visitors to the DPRK, an attempt to counter the narrative on the country's food shortages/hungry citizens. With three massive feasts a day and no opportunity to move, I felt due to explode at any moment.

I mentioned to the head of our group that I'd really like to get some exercise, and was told that there was a "spa" in the basement. I was led downstairs where I found a single treadmill and some weights. The treadmill was in a narrow, dark hallway. I asked the woman working there if I could use the treadmill, and she politely instructed me to take off my shoes. I complied, as one does in such a setting. I mounted my treadmill in my socks, ready for my first real movement in days. 

My minder promptly took position at the front of the treadmill, watching me, not saying a word. Two minutes into my socked workout, the woman returned, taking on the role of personal trainer, positioning herself next to the minder at the front of the machine. Looking me dead in the eyes, she began yelling, "Faster. Faster. Faster! FASTER!!!" I lasted a good 6 minutes before I politely told them that I was finished exercising for the day and returned to my room for a laugh and a jumping jack or two. 

