Moving to NYC in 2017 required a full reassessment of my relationship with the car. I had always favored Uber over public transportation, but learned in NYC that a single mile in rush hour traffic can take 45 minutes when traveling by car and only 5 on the subway. I also learned the that owning a car in NYC is the WORST and that I should have absolutely said no when my friend  offered me a 2003 Honda Civic for free.

The only time I ever drove it was trying to find a parking spot on the opposite side of the street every single day in an attempt to avoid an Alternate Side Cleaning parking ticket. It almost always took at least a half hour of searching before I could find a spot, and the Brooklyn parallel parking experience never failed to sprinkle in a bit of panic to a typically already pretty chaotic day. 

The cost of insurance + the not so infrequent parking ticket made this unused vehicle a money trap. I needed it gone. The problem here of course being that my friend had forgotten to give me the title to the car. With no title, I couldn't sell or even donate it. One day, after driving around for over an hour attempting to find a spot,  I'd had enough. I left it unlocked and, in the dust on the back window, wrote out "STEAL ME".

I am not typically the praying type, but that night, I prayed. Please, please, if you're out there, please send someone to steal my car. The next day I went back and... it was gone! It had worked! A true Brooklyn miracle! I walked around in a blissful state of freedom for the next several days until, when walking down a street I didn't usually pass by... there it was... my car, just as I'd left it, covered in parking tickets with STEAL ME still visible in the dust. It had very much NOT been stolen and I'd simply parked it a few blocks further south than I thought. #Whoopsie

