When I was a kid I anthropomorphized absolutely everything. One time, for example, my dad told me we would be going in for a tetanus shot later that day and I asked where they were going to give me the shot and he was like idk but maybe your butt. Thinking my butt had emotional feelings separate from my own, I promptly burst into tears. While many kids may weep after discovering they’re soon going to be getting a shot, my tears were not out of my own self pity but more out of a deep seated sympathy for my butt. And then I went and sang to it until the appointment. That was weird. (Turns out the shot was in my arm which is definitely preferable but I was mortified that I had been comforting the wrong area smdh my poor arm)

