My elementary school DARE officer, a mustachioed man named Deputy Tim with a flair for the dramatics who would end every single class by saying, "Now everybody say thank you Deputy Tim" to which we would reply "Thank you Deputy Tim" to which HE would reply "NO. Thank *YOU*" before dramatically turning and exiting the classroom without saying another word, had me constantly on the terrified lookout for strangers trying to give me drugs in parking lots. "No THANK YOU. No THANK YOU. No THANK YOU" I would chant on repeat in my head, fully prepared to turn down any drug dealer whose business strategy focused on giving out drugs for free to children in grocery store parking lots who were being escorted by their parents in broad daylight--"NO" because that's what you're just supposed to say when offered drugs and "THANK YOU" because I was also terrified of being rude #bless

Perhaps focusing on so many fears at such a young age is the reason I grew into such a well adjusted adult? *laughs a relatively unhinged laugh that gradually turns into a low gasping sob* 

