Almost every social studies teacher I had in high school was also the coach of a sports teams. Their top priority, without exception, was always their respective sports team, followed by lunch, the weather, chit chatting and dilly dallying, possibly some other list items, and then whatever history subject they’d been assigned to teach. 

On the first day of American History my Sophomore year, the teacher/basketball coach put on a reality show called something like Pioneer Life, in which wealthy suburbanites stayed in the forest for a month to live as pioneers. At the end of the first 45 minute episode which coincided perfectly with the end of our 45 minute class, he asked if we had enjoyed the show and if we’d like to watch the entire season. Being 16 and having little to no interest in American History, we all replied with an enthusiastic yes. And that, dear reader, is how we spent the remainder of the quarter. Every single class. No tests, no homework, just the glory of ✨reality television✨. 

If you, like me, gleaned your base level knowledge of history from someone who really would rather have been blowing a whistle at teenagers running laps, this history roundup can be considered some light supplemental reading ❤️ 

