An episode of This American Life that will live with me forever was an interview with producer Sarah Koenig’s mother, who is French. She has a list of seven topics that you’re really not supposed to talk about in France, and not because they’re offensive or taboo, but because they’re boring. (Should you wish to listen, it’s episode 511, The Seven Things You’re Not Supposed To Talk About) Don’t talk about minor health issues or menstrual cycles or dietary restrictions too much, no one cares. Don’t talk about how you slept or the route you took to get somewhere... snoozefest. And, the one that stuck with me the most, don’t go into long stories about dreams. BORING. 

The episode went on to tell this woman six different stories, one on each forbidden/boring topic, to see if any of them could, shall we say, impress her much. Some did. Some did not. I don’t remember which. But whenever I feel the need to start telling someone about a really crazy dream I had, I remember this episode and feel a bit of guilt which doesn’t necessarily stop me from telling said dream story... but it does make me preface the story with a quick “SORRY I know dream stories are the WORST but I want to tell you one but don’t worry I’ll keep it quick...” #teehee 

